(120, 71, ' ', 4, NULL, NULL, 'To: All staff\nFrom: Daniel Barker\nDate: August 29\nSubject: Recycling\n\nI would like to advise all staff members that new policies will be going into effect office-wide regarding the consumption of paper. An environmentally-based company such as ours needs to be a leader in the use of disposable products. In order to conserve both finances and the environment, we will be considering our use of paper.\n\nOur Finance Department has advised me that we are spending $40,000 annually on copy paper. (71)........\n\nWe will be increasing company awareness of recycling in the coming months; please check your mailboxes soon for a list of paper products that can be recycled. When you throw away these products, make sure to use the correct bins. Our building maintenance staff will (72)........ the recycled paper products each evening and transport them to the local recycling facilities.\nI would like to thank you in advance for taking advantage of this new program.\n\nThank you,\nDaniel Barker', 1.00, 1, 2, NULL, NULL, NULL),
