(133, 84, 'In the review, the word “affordable” in paragraph 1, line 5 is closest in meaning to', 4, NULL, NULL, 'Passage 1:\n\nTHEARTSTORE.COM\nAll-inclusive art resource for artists, students and lovers of exceptional design!\nYour source for Art Supplies, Painting Supplies, Craft Supplies, Drafting Supplies, Architecture Supplies, Digital Printing and Much More!\n\n* Weekend special! (Limited time offer while quantities last)\nReeves Ease! Painting Set – Watercolor, $25.99 - $16.99\nDecoColor Paint Markers – Assorted colors, $2.79 and up\nArt Alternatives Economy Sketchbooks (8.5’’x11’’), $9.65\n\nBuy a Coleman Watercolor Field Box Set and receive a six-color watercolor set free! (Regular price $60, Sale price $48) The Coleman Watercolor Field Box Set contains twelve Coleman half pans of moist watercolors, Sceptre pocket brush, artist sponge, water pot, white integral palette and thumb ring.\nFor consultation or questions, contact our customer service representatives at inquiry@thearstore.com.\n ************\nPassage 2:\n\nArt World\nInternational contemporary art and style magazine\nBaltimore’s best art supply store\nWhether you are a student, a hobbyist, or a serious artist, The Art Store has the best range of supplies at the consistently lowest price. If you need high-quality paper, paint, brushes, canvas, or more, The Art Store is the place to go. It is a national chain and carries its own brands of supplies, along with other brands. Since there is no middleman, The Art Store brand products are very affordable and high quality.\nAlso, there are always specials and sales on different items. Customers can sign up to get coupons and specials in the mail. The Art Store also has a preferred customer card that helps with getting the best price.\nThis weekend, The Art Store offers special discounts for watercolor paints, paint markers and sketchbooks. If you need to purchase back-to-school supplies for your child, you do not want to miss this opportunity to save. They also provide free USP ground shipping on orders over $100, although some supplies may take up to four weeks to arrive. For more details, check out their website, www.theartstore.com.', 1.00, 1, 2, NULL, NULL, NULL),
