(138, 89, 'Where does Eli Finance plan to begin operations?', 4, NULL, NULL, 'Arabian Business Weekly\nOctober 8\n\nEli Finance Awarded the Best Financial Services Company in the UAE\n\nEli Finance, the largest real estate financier in the Middle East by market value and total assets, today proudly announced that it received the award for the “Best Financial Services Company in the UAE” during the 2008 Liquid Real Estate Awards ceremony organized by Euromoney. Euromoney Liquid Real Estate Awards honor the world’s leading institutions for their ability to innovate and develop new products and services to meet the market’s demand in today’s increasingly challenging financial environment, as well as make the most efficient use of the inherent strengths within their organization. Speaking on the occasion, Mr. Ismael Alharmi, Chief Executive Officer of Eli Finance said, “We are honored to receive this prestigious award and I would like to thank our staff at Eli for their efforts. This award will leverage our position as the largest real estate financier in the region”. Eli won this award from a highly competitive list of contenders for its excellent performance and business expansion over the last ten months. Its half yearly net profit saw an increase of 155 percent and total assets, as of June 2008, stood at an astounding AED14.2bn, a growth of 133% compared to AED6.1bn as of June 2007. Eli has also set its global footprint in various international markets such as Egypt and Saudi Arabia, and plans to commence operations in Jordan and Qatar.', 1.00, 1, 2, NULL, NULL, NULL),
