(141, 92, 'What does Mr. Lehman want to do?', 4, NULL, NULL, 'From: Rachel\nTo: Sophie\n\nAs per our telephone conversation yesterday, I’m sending you the schedule for Mr. John Lehman’s business trip. I would appreciate it if you could book the flights and hotels based on this itinerary. Since he has several meetings scheduled in each city he visits in Europe, please note that Mr. Lehman must take early flights for all of his departures except for the New York to Berlin flight. He has an important lunch reception in New York on May 10th, so the earliest time he can depart is 3 p.m.\n\nMay 10: New York to Berlin\nMay 13: Berlin to Barcelona\nMay 15: Barcelona to Madrid\nMay 17: Madrid to Firenze\nMay 20: Fienze to New York\n\nBased on the information you have given me, I informed Mr. Lehman that there is no direct flight from Firenze to New York that fits his schedule. Therefore, please make sure that he has at least three hours to transfer so as not to miss his connecting flight due to any possible delays. Also, Mr. Lehman would like to change planes in Barcelona, if possible.\n\nIf you have questions or concerns, please let me know right away. Thank you for your assistance.', 1.00, 1, 2, NULL, NULL, NULL),
